import React from 'react';
import { Marker, Popup } from 'react-leaflet'


const MyMarker = ({ name, coordinates, onClick, active} ) => (
	<div onClick={onClick} 
		 style={{
		 		 color: active ? 'red' : 'black' }}
	>
		{name}<br/>
		{coordinates}
	</div>
)

export default CustomMarker
